use serde::{Deserialize, Serialize};#[derive(Deserialize)]#[derive(Debug)]pub struct GenesisBlock {    pub genesis_account: String,    pub fee_base_reserve: i64,    pub fee_gas_price: i64,    pub validators: Vec<String>,}impl  Clone for GenesisBlock{    fn clone(&self) -> Self {        Self{            genesis_account: self.genesis_account.clone(),            fee_base_reserve: self.fee_base_reserve,            fee_gas_price: self.fee_gas_price,            validators: self.validators.clone()        }    }}impl Default for GenesisBlock{    fn default() -> Self {        Self{            genesis_account: "".to_string(),            fee_base_reserve: 0,            fee_gas_price: 0,            validators: vec![]        }    }}